import React from "react";
import { BrowserRouter, Route, Router } from "react-router-dom";
import { Login } from "../"
function App() {

    return (

      <BrowserRouter>
        <Router>
          <Route path="/login" render={() => <Login/> } />
        </Router>
      </BrowserRouter>

    );

}
  
export default App;
